1/11 día mundial del veganismo 🥰🌱✨

La base del #veganismo es la ética del trato hacia los animales. La idea vegana rechaza aquellos alimentos o artículos de consumo obtenidos de la explotación cruel e innecesaria de los animales 🙏🏼

“Una dieta vegana es probablemente la mejor forma de reducir tu impacto en el planeta Tierra, no solo los gases de efecto invernadero, sino la acidificación global, la eutrofización, el uso de suelo y agua.” – Joseph Poore, investigador de Ciencias Ambientales, Universidad de Oxford.

Empezá a incorporar más alimentos #abasedeplantas a tu alimentación y vas a ver cómo tu cuerpo, mente y alma se sienten muchísimo mejor en todo sentido 😍✨

Muchos creen que comer vegano es aburrido y para nada es así 🫣

Hay infinitas posibilidades, combinaciones, #recetasveganas tanto acá en Instagram como en todo internet para inspirarte y empezar a cuidar de tu salud, el bienestar del planeta y los animales que son seres sintientes y para nada merecen ser explotados. 

Hay muchos documentales que te pueden ayudar a abrir los ojos sobre esta realidad, tales como:

• Game Changers - en Netflix
• What The Health - en Netflix
• Cowspiracy - en Netflix
• Seaspiracy - en Netflix 
• Earthlings - en YouTube 

Solo para mencionar algunos, porque la verdad qué hay un montón más, así como charlas de doctores, científicos, nutricionistas y personas especializadas en el tema! 

Te invito a que investigues por tu cuenta y pruebes 💪🏻

De lo único que te vas a arrepentir es de no haber empezado antes!!

